import math

def t1(n):
    return n * math.factorial(n) # O(n!) 

def t2(n):
    return 2 ** n # O(2^n)

def t3(n):
    return n * n * n * n # O(n^4)

def t4(n):
    return n * n * n # O(n^3)

def t5(n):
    return n * n # O(n^2)

def t6(n):
    return n * (math.log(n, 2)) # O(n*log(n))

def t7(n):
    return n # O(n)

